angular.module('vmMusic').run(['$templateCache', function($templateCache) {$templateCache.put('/directives/audioPlayer.html','<div id="audioPlayerContainer"><div class="playerDetails"><img ng-src="{{ btnPlayStatus() }}" class="btnplay" ng-click="togglePlay()"><div class="songInfo">{{ audioTitle }}<br>{{ timeIndicator }}</div><div class="volumecontroll">- volume +<br><input type="range" name="volume" min="0" max="1" step="0.05" ng-model="volume" ng-change="changeVolume()"></div><audio id="audioPlayer" preload="auto"><source id="oggSource" src="" type="audio/ogg"><source id="mpegSource" src="" type="audio/mpeg">Your browser cannot play this audio.</audio></div></div>');
$templateCache.put('/directives/audioSample.html','<div rel="{{ src }}" class="audioSample"><img ng-src="{{ btnPlay.status }}" style="cursor: pointer;" ng-click="togglePlayPaused()" on-enter="togglePlayPaused()" alt="play {{ songTitle }}" tabindex="0"><div ng-transclude></div></div>');
$templateCache.put('/directives/calendarEvent.html','<div class="eventDetails"><div class="itemTitle">{{ event.title }}</div><div class="eventTime">{{ event.startTime | timeZone | date: \'EEEE, MMMM dd, yyyy - h:mm a\' }}</div><div class="eventLocation">Location: <a href="http://maps.google.com/?q={{ event.location }}" target="_blank">{{ event.location }}</a></div><div class="info"><strong>More Info: </strong><span ng-bind-html="event.description | toTrusted"></span></div></div>');
$templateCache.put('/directives/featureEvent.html','<div id="hEvent"><h3>Upcoming</h3><p class="hevent_title">{{ event.title }}</p><p><a href="http://maps.google.com/?q={{ event.location }}" target="_blank">{{ event.location }}</a></p><p>{{ event.startTime | timeZone | date: \'EEEE, MMMM dd, yyyy - h:mm a\' }}</p><p>For more upcoming performances visit <a href="/calendar">calendar</a>.</p></div>');
$templateCache.put('/directives/navigation.html','<nav><ul><li class="menuTitle"><a href="#" title="Menu">MENU{{currentPage()}}</a></li><li><a href="/" title="Home Page">HOME</a></li><li><a href="/biography" title="Biography">BIOGRAPHY</a></li><li><a href="/calendar" title="Upcoming Events">CALENDAR</a></li><li><a href="/recordings" title="Recordings">RECORDINGS</a></li><li><a href="/videos" title="Video Gallery">YOUTUBE FEED</a></li><li><a href="/contact" title="Contact Information">CONTACT</a></li></ul></nav>');
$templateCache.put('/directives/videoSample.html','<a ng-click="playVideo()" on-enter="playVideo()" title="Play {{ videoTitle }}" class="videoLink" tabindex="0"><div class="btnPlay"><img src="/assets/img/site/btnPlay.png" alt="Play {{ videoTitle }}"></div><img ng-src="{{ videoThumbnail }}" title="{{ videoTitle }}" alt="Play {{ videoTitle }}"></a>');}]);